import "./AddUser.css";
const AddUser = () => {
  return (
    <div>
      <form>
        <label htmlFor="userName">User Name</label>
        <input type="text" id="userName"></input>
        <label htmlFor="userAge">User Name</label>
        <input type="number" id="userAge"></input>
        <button type="submit">Add User</button>
      </form>
    </div>
  );
};

export default AddUser;
